    "lajpcig_title": "–õ–∞—ò–ø—Ü–∏–≥",
    "lajpcig_desc1": "–£ –æ–∫–≤–∏—Ä—É –ø—Ä–æ–≥—Ä–∞–º–∞ Erasmus+, –Ω–∞—à–∏ —É—á–µ–Ω–∏—Ü–∏ –∏ –∑–∞–ø–æ—Å–ª–µ–Ω–∏ –±–æ—Ä–∞–≤–∏–ª–∏ —Å—É —É –ù–µ–º–∞—á–∫–æ—ò, —É –õ–∞—ò–ø—Ü–∏–≥—É, –≥–¥–µ —Å—É —Å—Ç–µ–∫–ª–∏ –Ω–æ–≤–∞ –∑–Ω–∞—ö–∞ –∏ —É–Ω–∞–ø—Ä–µ–¥–∏–ª–∏ —Å–≤–æ—ò–µ –∑–¥—Ä–∞–≤—Å—Ç–≤–µ–Ω–µ –≤–µ—à—Ç–∏–Ω–µ. –ü–æ—Å–µ–±–∞–Ω –∞–∫—Ü–µ–Ω–∞—Ç —Å—Ç–∞–≤—ô–µ–Ω —ò–µ –Ω–∞ –µ–¥—É–∫–∞—Ü–∏—ò—É –∏–∑ –æ–±–ª–∞—Å—Ç–∏ —É–ª—Ç—Ä–∞–∑–≤—É–∫–∞, –∫–∞–æ –∏ –Ω–∞ –Ω–∞—á–∏–Ω–µ –ø—Ä–µ–ø–æ–∑–Ω–∞–≤–∞—ö–∞ –∏ –ø—Ä–∏–º–µ–Ω–µ –æ–≤–æ–≥ –∑–Ω–∞—ö–∞ —É —Ä–∞–¥—É —Å–∞ —É—á–µ–Ω–∏—Ü–∏–º–∞ –∏ —É –∫–ª–∏–Ω–∏—á–∫–æ—ò –ø—Ä–∞–∫—Å–∏, —É–∑ –ø–æ—Å–µ–±–∞–Ω —Ñ–æ–∫—É—Å –Ω–∞ –æ—á—É–≤–∞—ö–µ –∏ –∑–∞—à—Ç–∏—Ç—É –∑–¥—Ä–∞–≤—ô–∞.",
    "lajpcig_desc2": "–ó–Ω–∞—á–∞—ò–∞–Ω –¥–µ–æ –ø—Ä–æ–≥—Ä–∞–º–∞ –±–∏–æ —ò–µ —É—Å–º–µ—Ä–µ–Ω –Ω–∞ –ø—Ä–∞–∫—Ç–∏—á–Ω—É –Ω–∞—Å—Ç–∞–≤—É –∏ —Ä–∞–¥ —É –∑–¥—Ä–∞–≤—Å—Ç–≤–µ–Ω–∏–º –∏ –ø–∞–ª–∏—ò–∞—Ç–∏–≤–Ω–∏–º —É—Å—Ç–∞–Ω–æ–≤–∞–º–∞. –£—á–µ–Ω–∏—Ü–∏ —Å—É –∏–º–∞–ª–∏ –ø—Ä–∏–ª–∏–∫—É –¥–∞ –ø–æ—Å–µ—Ç–µ —Ä–∞–∑–ª–∏—á–∏—Ç–µ –∫–ª–∏–Ω–∏—á–∫–µ –∏–Ω—Å—Ç–∏—Ç—É—Ü–∏—ò–µ, –≥–¥–µ —Å—É —Å–µ —É–ø–æ–∑–Ω–∞–ª–∏ —Å–∞ —Å–∞–≤—Ä–µ–º–µ–Ω–∏–º –º–µ—Ç–æ–¥–∞–º–∞ —Ä–∞–¥–∞ –∏ –∑–Ω–∞—á–∞—ò–µ–º –∫–ª–∏–Ω–∏—á–∫–æ–≥ –∏—Å–∫—É—Å—Ç–≤–∞ —É —Å–≤–∞–∫–æ–¥–Ω–µ–≤–Ω–æ—ò –∑–¥—Ä–∞–≤—Å—Ç–≤–µ–Ω–æ—ò –ø—Ä–∞–∫—Å–∏. –û–≤–∞ –∏—Å–∫—É—Å—Ç–≤–∞ –¥–æ–ø—Ä–∏–Ω–µ–ª–∞ —Å—É –±–æ—ô–µ–º —Ä–∞–∑—É–º–µ–≤–∞—ö—É —Ç–µ–æ—Ä–∏—ò—Å–∫–∏—Ö –∑–Ω–∞—ö–∞ –∫—Ä–æ–∑ —ö–∏—Ö–æ–≤—É –ø—Ä–∞–∫—Ç–∏—á–Ω—É –ø—Ä–∏–º–µ–Ω—É.",
    "lajpcig_desc3": "–ü–æ—Ä–µ–¥ —Å—Ç—Ä—É—á–Ω–æ–≥ –¥–µ–ª–∞ –ø—Ä–æ–≥—Ä–∞–º–∞, –æ—Ä–≥–∞–Ω–∏–∑–æ–≤–∞–Ω–µ —Å—É –∏ –∞–∫—Ç–∏–≤–Ω–æ—Å—Ç–∏ —É—Å–º–µ—Ä–µ–Ω–µ –Ω–∞ —É–ø–æ–∑–Ω–∞–≤–∞—ö–µ —Å–∞ –∫—É–ª—Ç—É—Ä–Ω–∏–º –∏ –∏—Å—Ç–æ—Ä–∏—ò—Å–∫–∏–º –∑–Ω–∞–º–µ–Ω–∏—Ç–æ—Å—Ç–∏–º–∞ –õ–∞—ò–ø—Ü–∏–≥–∞. –£—á–µ–Ω–∏—Ü–∏ —Å—É –∏–º–∞–ª–∏ –ø—Ä–∏–ª–∏–∫—É –¥–∞ –ø–æ—Å–µ—Ç–µ –∑–Ω–∞—á–∞—ò–Ω–∞ –º–µ—Å—Ç–∞ –æ–≤–æ–≥ –≥—Ä–∞–¥–∞ –∏ –¥–∞ —Å–µ —É–ø–æ–∑–Ω–∞—ò—É —Å–∞ —ö–µ–≥–æ–≤–æ–º –±–æ–≥–∞—Ç–æ–º –∫—É–ª—Ç—É—Ä–Ω–æ–º –±–∞—à—Ç–∏–Ω–æ–º, —à—Ç–æ —ò–µ –¥–æ–¥–∞—Ç–Ω–æ –æ–±–æ–≥–∞—Ç–∏–ª–æ —Ü–µ–ª–æ–∫—É–ø–Ω–æ –∏—Å–∫—É—Å—Ç–≤–æ –±–æ—Ä–∞–≤–∫–∞.",
